import styled from 'styled-components';
import { FormControl, FormLabel, Input, Button, VisuallyHidden } from '@chakra-ui/react';
import { Link } from 'react-router-dom';
import { Search2Icon } from '@chakra-ui/icons';

const Langs = () => {
  return (
    <LangsWrap>
      <Link className="on" to="/">
        KOR
      </Link>
      <Link to="/">ENG</Link>
    </LangsWrap>
  );
};

const LangsWrap = styled.nav`
  margin-left: 0.6rem;
  a {
    display: flex;
    align-items: center;
    position: relative;
    height: 45px;
    padding: 0 1rem;
    white-space: nowrap;
    color: var(--gray-5);
    &::before {
      content: '';
      position: absolute;
      top: 50%;
      left: 0;
      transform: translateY(-45%);
      width: 1px;
      height: 12px;
      background: var(--gray-5);
    }
    &:first-child::before {
      display: none;
    }
    &:hover {
      color: var(--black);
    }
    &.on {
      color: var(--black);
    }
  }
`;

export default Langs;
